import React from "react";
import Highcharts, { color } from 'highcharts';
import HighchartsReact from "highcharts-react-official";
import drilldown from "highcharts/modules/drilldown"
import mlData from '../allData/mlData';

function DrillDownPie() {
  drilldown(Highcharts);
  let options = {
    chart:
    {
      type: 'pie',
      backgroundColor:'transparent',
      height:'300px'
    },
    plotOptions:
    {
      pie:
      {
        borderWidth:0.5,
      }
    },
    lang: {drillUpText: '<< Back to Top'},
    title: 
    {
      style:{color:'white',fontSize:'15px',fontFamily:'cursive'},
      text: '(Click on each section for more info)'
      
    },
    series: [
      {
          name: "ML",
          colorByPoint: true,
          data: [
              {
                  name: "NLP",
                  y: 27.00,
                  drilldown: "NLP"
              },
              {
                  name: "RecSys",
                  y: 15.00,
                  drilldown: "RecSys"
              },
              {
                  name: "FrameWorks",
                  y: 25.00,
                  drilldown: "FrameWorks"
              },
              {
                  name: "Algos",
                  y: 33.00,
                  drilldown: "Algos"
              }
          ]
      }
  ],
  drilldown: {
    drillUpButton:
    {
      position:{
        y:-10,
        x:0
      },
      theme: {
        fill:'red',
        'stroke-width':1,
        stroke:'silver'
      }
    },
      series: [
          {
              name: "NLP",
              id: "NLP",
              data: [
                  [
                      "MultiClass Classification",
                      20.00
                  ],
                  [
                      "SentimentAnalysis",
                      30.00
                  ],
                  [
                      "Topic Modeling",
                      20.00
                  ],
                  [
                      "NER",
                      15.00
                  ],
                  [
                      "Extractive Summarization",
                      15.00
                  ]
              ]
          },
          {
              name: "RecSys",
              id: "RecSys",
              data: [
                  [
                      "Content-based Filtering",
                      40
                  ],
                  [
                      "Collaborative Filtering",
                      30
                  ],
                  [
                      "KNN",
                      30
                  ]
              ]
          },
          {
              name: "FrameWorks",
              id: "FrameWorks",
              data: [
                  [
                      "PyTorch",
                      22
                  ],
                  [
                      "TensorFlow",
                      21
                  ],
                  [
                      "Scikit-Learn",
                      17
                  ],
                  [
                    'Keras',
                    10
                  ],
                  [
                    'HuggingFace',
                    30
                  ]

              ]
          },
          {
              name: "Algos",
              id: "Algos",
              data: [
                  [
                      "Linear Regression",
                      27
                  ],
                  [
                      "Logistical Regression",
                      23
                  ],
                  [
                      "PCA",
                      10
                  ],
                  [
                      "SVM",
                      10
                  ],
                  [
                      "Neural Networks",
                      30
                  ]
              ]
          },
      ]},
        
    credits: {
      enabled:false
    }
  }


  return (
    <span>
      <HighchartsReact 
        highcharts={Highcharts}
        options={options}
      />
    </span>
  )
}

export default DrillDownPie;
